import Shell from "./Shell";
import { CardContent, Container } from "@mui/material/TextField";
import store from "../../store";
import { getState, useTheme } from "redux";

function Policies() {
  const theme = useTheme();
  const styles = (theme) => {};
  return (
    <Shell
      heading="Policies"
      index={4}
      content={
        // store.getState().policies.map((policy) => (
        //   <p>{policy.policy}</p>
        // ))
        <CardContent sx={styles(theme).cardContent}>
          <Container
            {...properties.businessContainer}
            sx={styles(theme).businessContainer}
          >
            {store.getState().policies.map((policy) => (
              <p>{policy.policy}</p>
            ))}
          </Container>
        </CardContent>
      }
    />
  );
}

export default Policies;
